import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';
import ApplicantHomepage from './components/ApplicantHome';
import RecruiterHomepage from './components/RecruiterHome';
import React from 'react';

function App() {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<Login />} />
                <Route path="/register" element={<Register />} />
                <Route path="/applicant-homepage" element={<ApplicantHomepage />} />
                <Route path="/recruiter-homepage" element={<RecruiterHomepage />} />
            </Routes>
        </Router>
    );
}

export default App;
